import "./product.css";
import QuantityPicker from "./quantityPicker";
import Catalog from "../services/service.js";

const Product = () => {
  let price = Math.ceil(Math.random() * 10);
  // let totalPrice = price * "#quantityIndicator".innerHTML();
  return (
        <div className="product">
          <div className="page-deets">
            <h2>Iterate over Array and display data</h2>
          </div>
    
          {/* Iterate over imported array in userData */}
          <div className="users">
            {Catalog.map((user, index) => (
              <div key={index}>
                <h3>{user.title}</h3>
                <p>{user.image}</p>
                <p>{user.price}</p>
              </div>
            ))}
          </div>
          
        </div>
      );
    }

    // 
    // 
    // 
    // 
    // 
    <div className="product">
      {Catalog[1].image}
      <p>Price {price} each</p>
      <QuantityPicker></QuantityPicker>
      <p>Total Cost</p>
    </div>
  ;
;

export default Product;
